    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-27T00:06:07.578236",nt"name":
    "aquaculture-willingness-to-pay-hawaii-survey-2010",nt"isopen": false,nt"url":
    null,nt"notes": "A survey was conducted and implemented in Hawaii in 2010 to
    investigate consumer perceptions and preferences including consumer awareness concerning
    production methods (farm-raised vs. wild-caught), seafood labeling, and environmental
    issues. The survey also addresses food safety and nutrition, cultural traditions,
    consumption patterns, and taste and product form preferences. The data was collected
    through surveys online, at Times Supermarket locations and farmers' markets. 523
    responses were collected: 183 online and 340 in-person. A conjoint analysis estimated
    willingness to pay across four different fish species, tuna, salmon, tilapia and
    moi (Pacific threadfin). This data can be used to determine species-specific attributes
    that affect consumers' willingness to pay and purchasing decisions.",nt"license_title":
